    const {loading,  handleApiCall} = useFetchData();
    const {user, rooms, selectedRoom, showNewRoomForm, setRoomType, setShowNewRoomForm, setRooms, setSelectedRoom} = useAppStore();

    useEffect(() => {
        const {id: userId, token} = user;
        Promise.all([
            handleApiCall({path: 'chat', action: 'getUserRooms', token, data: {userId}}),
            Promise.resolve([]) // handleApiCall({path: 'chat', action: 'searchUsers', token, data: {}})
        ]).then(([roomItems, userItems]: [roomItems: Room[], userItems: RoomUser[]]) => {

            roomItems = roomItems.map(room => Utils.formattedRoom({room, currentUser: user}));

            const allRooms = [...roomItems, ...userItems];
            setRooms({rooms: allRooms});
        })
    }, [loading]);

    const setUnreadMessageCount = ({roomUri, count}) => {
        const room = rooms.find(room => room.uri === roomUri);
        if(room) {
            room.unreadMessageCount  = count;
            setRooms({rooms});
        }
    }

    const handleRoomClick = ({room}: {room: Room}) => {
        const {roomUri, uri, type} = room;

        setUnreadMessageCount({roomUri: (roomUri || uri), count: 0});
        setSelectedRoom({room: room as Room});
    };

    const handleDmMessaging = (dmUser: RoomUser = undefined) => {
        // Since user ids are unique, we can join them in sorted order to have a unique DM room id
        // Need a way to prevent collision if there is already a generic room with that id
        const roomUri = Utils.getDmRoomUri({dmUser, currentUser: user});
        const fromUser: RoomUser = {userId: user.id, fullname: user.fullname};
        const room: Room = {name: dmUser.fullname, addedBy: user.id, users: [fromUser, dmUser], roomUri, uri: roomUri, type: 'dm', active: 0};

        setSelectedRoom({room});
    }

